Daniel Blackman, &quot;Tests in English - Phrasal Verbs : Level: Upper Internediate and Advanced (with Keys)&quot; 
 WSiP Wydawnictwa Szkolne i Pedagogiczne | 2009 | ISBN: 8302053184 | 136 pages | PDF | 6.25 MB 

 The book is a collection of tests designed for Upper Internediate and Advanced Level. It allows you to test your skills. The key is attached, you can use it without the help of a teacher.
